commits.content:
.results {
  list-style: none;
  padding: 0;
  margin: 10px 0;
}

.results li {
  padding: 5px 0;
  cursor: pointer;
}

.results.list {
  list-style: none;
  padding: 0;
  margin: 0;
}

.results.list .result-item {
  display: flex;
  align-items: center;
  margin-bottom: 10px;
}

.results.tile {
  display: flex;
  flex-direction: column;
  gap: 12px;
}

.tile-row {
  display: flex;
  justify-content: space-between;
  gap: 20px;
}

.tile-item {
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
}
